  // src/main-features/keybinds.js
  document.addEventListener("keyup", async (e) => {
    if (e.target?.tagName === "INPUT") return;
    if (e.target?.tagName === "TEXTAREA") return;
    if (document.getElementById("tinymce")) return;
    const key = e.key === " " ? "Space" : e.key.length === 1 ? e.key.toUpperCase() : e.key;
    if ((typeof keybinds === "undefined" || !keybinds || Object.keys(keybinds).length === 0) && key === ":") {
      do_qm("dmenu");
      return;
    }
    switch (key) {
      case keybinds.dmenu:
        do_qm(keybinds.dmenu);
        break;
      case keybinds.settings:
        openSettingsWindow(e);
        break;
      case keybinds.gc:
        openGlobalChat(e);
        break;
    }
    if (!widgetEditModeInit) return;
    if (key === "Escape" && widgetEditMode) {
      await setEditMode(false);
      return;
    }
    switch (key) {
      case keybinds.widgetEditMode:
        await setEditMode(true);
        break;
      case keybinds.widgetBag:
        if (widgetEditMode) toggleBag();
        break;
    }
  });

  // src/main-features/appearance/background-image.js
  async function setBackground(appearance) {
    function displayBackgroundImage(image) {
      document.documentElement.style.setProperty(
        "--background-color",
        `transparent`
      );
      let img = document.getElementById("background_image") || document.createElement("img");
      img.id = "background_image";
      img.style.backgroundColor = "var(--color-base00)";
      img.style.position = "absolute";
      img.style.top = "0";
      img.style.left = "0";
      img.style.width = "100%";
      img.style.height = "100%";
      img.style.objectFit = "cover";
      img.style.zIndex = -1;
      img.style.display = "block";
      if (image) img.src = image;
      if (!document.getElementById("background_image") && !document.getElementById("tinymce")) {
        document.body.appendChild(img);
      }
    }
    let result = await browser2.runtime.sendMessage({
      action: "getImage",
      id: "backgroundImage"
    });
    if (result.type == "default") {
      result.imageData = await getExtensionImage(
        "theme-backgrounds/" + appearance.theme + ".jpg"
      );
    }
    displayBackgroundImage(result.imageData);
  }

